import React from "react";

const Weather = props => (
    <div>
  <div className="weather__value"> { props.city }, { props.country }</div>

      <div className="weather__value"> { props.temperature }	</div>

      <div className="weather__value"> { props.humidity } </div>

      <div className="weather__value"> { props.description } </div>

  { 
    props.error && <p className="weather__error">{ props.error }</p>  
  }
 </div>
);

export default Weather;
